signatures: >-
  get_bank_branches(bank_id: int) : List[Dict[str, Union[str, int]]] - Fetches a
  list of bank branches for a given bank_id from the FDIC API. Returns a list of
  dictionaries, each containing 'id', 'address', 'city', 'county', 'state', and
  'zip' of branches.


  get_bank_financials(bank_id: int) : List[Dict[str, Union[str, int]]] - Fetches
  bank financials for a given bank_id from the FDIC API. Returns a list of
  dictionaries, each containing 'report_date' and 'total_deposits'.


  get_bank_id_by_name(name: str) : int - Fetches the bank_id for a given bank
  name from the FDIC API. Returns the ID of the bank.


  create_workbook() : openpyxl.Workbook - Creates and returns a new Openpyxl
  Workbook instance.


  auto_size_column_width(worksheet: openpyxl.worksheet.worksheet.Worksheet) :
  None - Adjusts the column width of an Openpyxl worksheet based on the length
  of the content in each column.


  add_worksheet(workbook: openpyxl.Workbook, sheet_name: str) :
  openpyxl.worksheet.worksheet.Worksheet - Adds a new worksheet with the
  specified name to an Openpyxl workbook. Returns the created worksheet.


  add_table_rows(worksheet: openpyxl.worksheet.worksheet.Worksheet, start_row:
  int, start_col: int, rows: List[List[Union[str, int]]], formats:
  Optional[List[str]] = None) : None - Adds rows of data to the specified
  worksheet starting from the given row and column. Optionally applies the
  provided formats to each column.


  add_table_header(worksheet: openpyxl.worksheet.worksheet.Worksheet, row: int,
  col: int, column_names: List[str]) : None - Adds a table header to the
  specified row and column in the worksheet. Each column name is bolded,
  centered, and bordered.
